function toggleType(){
    if (map.getLayoutProperty('Typology', 'visibility') === 'visible') {
        map.setLayoutProperty('Typology', 'visibility', 'none');
    } else {
    	map.setLayoutProperty('Typology', 'visibility', 'visible'); 
        map.setLayoutProperty('ini', 'visibility', 'none');  
        map.setLayoutProperty('vul_00', 'visibility', 'none');   
        map.setLayoutProperty('vul_18', 'visibility', 'none');    
    }
    updateToggles();
    showDescription(sites[1]);
}

function toggleYr00(){
    if (map.getLayoutProperty('vul_00', 'visibility') === 'visible') {
        map.setLayoutProperty('vul_00', 'visibility', 'none');
    } else {
        map.setLayoutProperty('vul_00', 'visibility', 'visible');
        map.setLayoutProperty('Typology', 'visibility', 'none');
        map.setLayoutProperty('ini', 'visibility', 'none');
    }
    updateToggles();
    showDescription(sites[0]);
}

function toggleYr18(){
    if (map.getLayoutProperty('vul_18', 'visibility') === 'visible') {
        map.setLayoutProperty('vul_18', 'visibility', 'none');
    } else {
        map.setLayoutProperty('vul_18', 'visibility', 'visible');
        map.setLayoutProperty('Typology', 'visibility', 'none');
        map.setLayoutProperty('ini', 'visibility', 'none');
    }
    updateToggles();
    showDescription(sites[0]);
}

function updateToggles(){

    if (map.getLayoutProperty('Typology', 'visibility') === 'visible'){
        $('#type-toggle').removeClass('fa-circle-o').addClass('fa-check-circle').removeClass('deactivated');
        $('#typology-legend').fadeIn(500);
        $('#vul00-legend').fadeOut(500);
        
    } else {
        $('#type-toggle').removeClass('fa-check-circle').addClass('fa-circle-o').addClass('deactivated');
        $('#typology-legend').fadeOut(500);
    }

    if (map.getLayoutProperty('vul_00', 'visibility') === 'visible'){
        $('#yr00-toggle').removeClass('fa-circle-o').addClass('fa-check-circle').removeClass('deactivated');
        $('#vul00-legend').fadeIn(500);
        $('#typology-legend').fadeOut(500);
    } else {
        $('#yr00-toggle').removeClass('fa-check-circle').addClass('fa-circle-o').addClass('deactivated');
             
    }

    if (map.getLayoutProperty('vul_18', 'visibility') === 'visible'){
        $('#yr18-toggle').removeClass('fa-circle-o').addClass('fa-check-circle').removeClass('deactivated');
        $('#vul00-legend').fadeIn(500);
        $('#typology-legend').fadeOut(500);
    } else {
        $('#yr18-toggle').removeClass('fa-check-circle').addClass('fa-circle-o').addClass('deactivated'); 
    }
}

